import React, { useState } from 'react';
import {
    getAdminAuthorizedMessage,
    getAdminOnlyMessage, getArtistAuthorizedMessage,
    getArtistOnlyMessage,
    getAuthorizedMessage,
    getUserOnlyMessage
} from '../Api/AuthApi'; // Import your API functions

const HomePage = () => {
    const [authorizedMessage, setAuthorizedMessage] = useState('');
    const [userOnlyMessage, setUserOnlyMessage] = useState('');
    const [adminAuthorizedMessage, adminSetAuthorizedMessage] = useState('');
    const [adminOnlyMessage, setAdminOnlyMessage] = useState('');
    const [artistAuthorizedMessage, artistSetAuthorizedMessage] = useState('');
    const [artistOnlyMessage, setArtistOnlyMessage] = useState('');

    const handleGetAuthorizedMessage = async () => {
        try {
            const message = await getAuthorizedMessage();
            setAuthorizedMessage(message);
        } catch (error) {
            console.error('Error:', error);
        }
    };

    const handleGetUserOnlyMessage = async () => {
        try {
            const message = await getUserOnlyMessage();
            setUserOnlyMessage(message);
        } catch (error) {
            console.error('Error:', error);
        }
    };
    const handleGetAdminAuthorizedMessage = async () => {
        try {
            const message = await getAdminAuthorizedMessage();
            adminSetAuthorizedMessage(message);
        } catch (error) {
            console.error('Error:', error);
        }
    };
    const handleGetAdminOnlyMessage = async () => {
        try {
            const message = await getAdminOnlyMessage();
            setAdminOnlyMessage(message);
        } catch (error) {
            console.error('Error:', error);
        }
    };

    const handleGetArtistOnlyMessage = async () => {
        try {
            const message = await getArtistOnlyMessage();
            setArtistOnlyMessage(message);
        } catch (error) {
            console.error('Error:', error);
        }
    };
    const handleGetArtistAuthorizedMessage = async () => {
        try {
            const message = await getArtistAuthorizedMessage();
            artistSetAuthorizedMessage(message);
        } catch (error) {
            console.error('Error:', error);
        }
    };




    return (
        <div>
            <h2>Welcome to our Application</h2>
            <div>
                <button onClick={handleGetAuthorizedMessage}>Get Authorized Message</button>
                <p>{authorizedMessage}</p>
            </div>
            <div>
                <button onClick={handleGetUserOnlyMessage}>Get User Only Message</button>
                <p>{userOnlyMessage}</p>
            </div>
            <div>
                <button onClick={handleGetAdminAuthorizedMessage}>Get Admin Authorized Message</button>
                <p>{adminAuthorizedMessage}</p>
            </div>
            <div>
                <button onClick={handleGetAdminOnlyMessage}>Get Admin Only Message</button>
                <p>{adminOnlyMessage}</p>
            </div>
            <div>
                <button onClick={handleGetArtistAuthorizedMessage}>Get Artist Authorized Message</button>
                <p>{artistAuthorizedMessage}</p>
            </div>
            <div>
                <button onClick={handleGetArtistOnlyMessage}>Get Artist Only Message</button>
                <p>{artistOnlyMessage}</p>
            </div>
        </div>
    );
};

export default HomePage;
